import React from 'react';
import { NavLink } from 'react-bootstrap';
import Home from './Home';

const Error = () => {
  return (
    <>
     <h1> page not found</h1>
     <NavLink to="/" component={Home}> go to home </NavLink>
    </>
  )
}

export default Error;
